import{_ as l,c as t,o as i,ah as r,aj as a}from"./chunks/framework.B2nwBQLy.js";const f=JSON.parse('{"title":"Finishing up","description":"","frontmatter":{},"headers":[],"relativePath":"ending.md","filePath":"ending.md","lastUpdated":1762937800000}'),o={name:"ending.md"};function n(s,e,h,u,p,d){return i(),t("div",null,[...e[0]||(e[0]=[r('<h1 id="finishing-up" tabindex="-1">Finishing up <a class="header-anchor" href="#finishing-up" aria-label="Permalink to “Finishing up”">​</a></h1><p>Done! Enjoy Linux on your PS4! Please share this guide if it was helpful! For any questions on this guide, make an issue, with general Linux issues use the links provided at the start of the guide to get to the PS4Linux Forums.</p><p>Now go forth, spread misinformation online.</p><img src="'+a+'" width="50%"><div class="tip custom-block github-alert"><p class="custom-block-title">TIP</p><p>I highly recommend continuing to the <a href="./postinstall.html">&quot;Post Installation&quot; setup</a>, to change language and downloading RAM!</p></div><div class="note custom-block github-alert"><p class="custom-block-title">NOTE</p><p>For any problems, <a href="./issues.html">check the issues page</a>!</p><p>Thanks for reading! Star this project on GitHub if you want to support the guide!</p></div><h2 id="credits" tabindex="-1">Credits <a class="header-anchor" href="#credits" aria-label="Permalink to “Credits”">​</a></h2><h3 id="kernel-developers" tabindex="-1">Kernel developers <a class="header-anchor" href="#kernel-developers" aria-label="Permalink to “Kernel developers”">​</a></h3><p>These are the original kernel developers, who did the hard work to port the kernels on which all of the modern kernels are based on:</p><ul><li>4.4 kernel <ul><li>marcan, fail0verflow team</li></ul></li><li>4.14 kernel <ul><li>rancido, and psxitateam, eeply, valery for Baikal (based on fail0verflow)</li></ul></li><li>4.19 and 5.3 kernel <ul><li>mircoho, (based on fail0verflow, psxitateam, eeply, valeryy)</li></ul></li><li>5.15 kernel <ul><li>codedwrench (based on fail0verflow, psxitateam, eeply, valeryy, mircoho)</li></ul></li><li>6.15 kernel <ul><li>crashniels with 2 patches from mircoho (fastboot and ethernet kp fixes) (based on fail0verflow - psxitateam - eeply - valeryy - mircoho - codedwrench)</li></ul></li></ul><p>If you want, you can check out their repos:</p><ul><li><a href="https://github.com/fail0verflow/ps4-linux" target="_blank" rel="noreferrer">marcan (fail0verflow) </a><ul><li>Without them nothing would&#39;ve ever been possible.</li></ul></li><li><a href="https://github.com/Ps3itaTeam/ps4-linux/" target="_blank" rel="noreferrer">rancido (psxitateam)</a><ul><li>Made the AMDGPU driver work.</li></ul></li><li><a href="https://github.com/eeply/ps4-linux" target="_blank" rel="noreferrer">eeply</a><ul><li>Brought PS4 Pro to work for video output, in fact now all ps4 with new Panasonic HDMI chip work.</li></ul></li><li>valeryy (no GitHub, gave the code to rancido) <ul><li>Brought the Baikal Southbridge support.</li></ul></li><li><a href="https://github.com/tihmstar/ps4-linux" target="_blank" rel="noreferrer">tihmstar</a><ul><li>Brought the Internal SATA driver for PS4 Belize.</li></ul></li><li><a href="https://github.com/ps4boot/ps4-linux" target="_blank" rel="noreferrer">mircoho</a> (<a href="https://github.com/ps4gentoo/ps4-linux-5.3.7" target="_blank" rel="noreferrer">ps4gentoo</a> and <a href="https://github.com/ps4boot/" target="_blank" rel="noreferrer">ps4boot</a>) <ul><li>Worked on the kernel (especially Gentoo), ported payloads to newer firmwares.</li></ul></li><li><a href="https://github.com/codedwrench/ps4-linux" target="_blank" rel="noreferrer">codedwrench</a><ul><li>Made kernel patches.</li></ul></li><li><a href="https://github.com/crashniels/linux" target="_blank" rel="noreferrer">crashniels</a><ul><li>Ported newer kernel versions.</li></ul></li><li><a href="https://github.com/feeRnt/ps4-linux-12xx" target="_blank" rel="noreferrer">feeRnt</a> (Package) <ul><li>Hosts and maintains the PS4 Linux kernel sources on GitHub.</li></ul></li></ul><p>Additionally, I also want to mention:</p><ul><li><a href="https://www.youtube.com/@saya7068" target="_blank" rel="noreferrer">saya</a><ul><li>For their kernels and tutorials.</li></ul></li><li><a href="https://www.youtube.com/@trakerchris9876" target="_blank" rel="noreferrer">triki1</a><ul><li>Also for their kernel and tutorials.</li></ul></li></ul><p>Thank you all so much for making this possible.</p><h2 id="post-install-setup-is-next" tabindex="-1">Post install setup is next! <a class="header-anchor" href="#post-install-setup-is-next" aria-label="Permalink to “Post install setup is next!”">​</a></h2><p>Go and modify your distro in the next step. You will find a lot of useful stuff!</p>',17)])])}const m=l(o,[["render",n]]);export{f as __pageData,m as default};
